import React from 'react'
import { render } from 'react-dom'
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'

const options = {
    title: {
        text: 'My Chart'
    },
    seeries: [{
        data: [1, 2, 3]
    }]
}

const App = () => <div>
    <HighchartsReact 
        highcharts={Highcharts}
        options={options}
    />
</div>
export default function ChartView(){
  return App
}
